window.bookSummaryJSON = "<p><b><i>Vale of the Gods</i></b><b> is the explosive conclusion to the epic adventure that has been The Furyck Saga.</b></p> <p>Draguta Teros wants to crush her enemies...every last one of them: Her disloyal sister, Dara; Briggit Halvardar and her followers; Jael Furyck and her Brekkan army; the gods themselves.</p> <p>But Draguta will not be cowed by any of them. She will have her revenge.</p> <p>They want her? They want to take the Book of Darkness? Let them come and die trying.</p>"; 
